GO



alter table DIM_CLIENTES
    drop column if exists SK;
go
exec sp_rename 'DIM_CLIENTES.DIM_CLIENTESID', SK_CLIENTE, 'COLUMN';
go


SELECT * FROM DIM_CLIENTES;



